        /* hidden width */
        int H = 32;
        int chunks = H / 4;
        /* # Linear layers */
        int depth = 3;
        // And offsets into the flat buffers:
        /* index of first fourier B-vec */
        int offB = 0;
        /* index of first input‐weight mat */
        int offInW = 0;
        /* index of first input bias vec */
        int offInB = 64;
        /* offset per hidden‐layer weight block group */
        int[] offHW = { 256 };
        /* offset per hidden‐layer bias vec group */
        int[] offHB = { 72 };
        /* output‐weight blocks */
        int offOutW = 320;
        /* output‐bias vec */
        int offOutB = 80;

        targetMaterial.SetInt("_L", L);
        targetMaterial.SetInt("_H", H);
        targetMaterial.SetInt("_Chunks", chunks);
        targetMaterial.SetInt("_Depth", depth);

        targetMaterial.SetInt("_OffB", offB);
        targetMaterial.SetInt("_OffInW", offInW);
        targetMaterial.SetInt("_OffInB", offInB);
        targetMaterial.SetInt("_OffHW", offHW[0]);
        targetMaterial.SetInt("_OffHB", offHB[0]);
        targetMaterial.SetInt("_OffOutW", offOutW);
        targetMaterial.SetInt("_OffOutB", offOutB);
    }

    Texture2D MakeFloat4Texture(List<Vector4> data, int width, int height)
    {
        var tex = new Texture2D(width, height, TextureFormat.RGBAFloat, false, true);
        tex.filterMode = FilterMode.Point;
        tex.wrapMode = TextureWrapMode.Clamp;

        Color[] pixels = new Color[width * height];
        for (int i = 0; i < data.Count; i++)
        {
            pixels[i] = data[i]; // Color implicitly converts from Vector4
        }

        tex.SetPixels(pixels);
        tex.Apply(false, true); // make it non-readable after upload
        return tex;
    }


    void OnDestroy()
    {
        _matBuf?.Release();
        _vecBuf?.Release();
    }
}
